this.U4="parameters{\n    legHeight \x3d 60\n    legWidth \x3d 40\n    circRadius \x3d 25\n    inset \x3d 5\n    tableWidth \x3d 80\n    tableOffset \x3d 5\n    thk \x3d 5\n}\n\n// Sketch out the leg of the table\nlegBase \x3d Rectangle(pt(0,0), legWidth, legHeight)\nlegSubL \x3d Circle(legBase.center, circRadius)\n            .translate((legWidth / 2) + (circRadius - inset), 0)\nlegSubR \x3d legSubL.rotateDeg(legBase.center, -180)\nlegSubB \x3d legSubL.rotateDeg(legBase.center, -90)\n                 .translate(0, - (legHeight - legWidth) / 2.0)\nlegSubCen \x3d Circle(legBase.center, thk/2)\n                 .translate(0, legHeight / 8)\ntableLeg \x3d DifferenceAll(legBase, Seq(legSubL, legSubB, legSubR, legSubCen))\nleg3d \x3d Extrude3D(tableLeg, thk)\n\n// Sketch out the top\ntableTopBase \x3d Rectangle(pt(0,0), tableWidth, legWidth + (tableOffset * 2))\ntableTop \x3d Fillet(tableTopBase, tableTopBase.points, tableOffset)\ntableTop3d \x3d Extrude3D(tableTop, thk)\n\n// Position the legs\nlegSeparation \x3d single(query(tableTop.edges, from(tableTopBase.bottom))).length - thk\nleg3dL \x3d leg3d.rotateXDeg(90).rotateZDeg(90)\nleg3dR \x3d leg3dL.translate(legSeparation, 0, 0)\n\n// Position the tabletop\ntableBasePoint \x3d single(query(tableTop3d.baseEdges, from(tableTopBase.left))).end\ntableTargetPoint \x3d single(query(leg3dL.basePoints, from(legBase.topLeft)))\ntableTop3d \x3d tableTop3d.move(tableBasePoint, tableTargetPoint).translate(-tableOffset, 0, 0)\n\n// Construct the middle frame using references from the 3D geometry\nq \x3d from(legBase.top)\nmidLpt \x3d single(query(leg3dL.outerEdges, q)).midpoint\nmidRpt \x3d single(query(leg3dR.baseEdges, q)).midpoint\nmidW \x3d midRpt.x - midLpt.x\nmidY \x3d midLpt.y - (thk / 2)\nmidR \x3d Rectangle(pt(midLpt.x, midY), midW, thk)\nmid3d \x3d Extrude3D(midR, legHeight / 4).translate(0, 0, legHeight / 2)\n\ndraw(leg3dR, leg3dL, tableTop3d, mid3d, color(beige), stroke(gray), style(translucent))\n";
