this.Q4="parameters {\n holeR \x3d 10\n tThk \x3d 2.4\n tOut \x3d 4.0\n hexR \x3d 3.0\n}\n\nc \x3d Circle(pt(0,0), holeR)\nt \x3d Rectangle(pt(-tThk/2, -tOut/2), tThk, tOut)\n\ntooth \x3d t.translate(0, holeR)\ncPointQuery \x3d (from(t.right) or from(t.left)) and not(derivedFrom(t.bottom))\n\ntooth \x3d Chamfer(tooth, query(tooth.points, cPointQuery), tThk/3)\ntooth \x3d Chamfer(tooth, query(tooth.points, cPointQuery), tThk/4)\ntooth \x3d Chamfer(tooth, query(tooth.points, cPointQuery), tThk/4)\n\nnTeeth \x3d 18 \nteeth \x3d Tabulate(nTeeth, i \x3d\x3e tooth.rotateDeg(pt(0,0), 360 * (i / nTeeth)))\ngear \x3d UnionAll(c, teeth)\n\nhex \x3d Polygon(pt(0,0), 6, hexR)\nkey \x3d Rectangle(hex.edges(1).midpoint, 2, 1).translate(-1, -0.5)\ngear \x3d Difference(gear, Union(hex,key))\n\ndraw(Extrude3D(gear, 4.0), style(translucent))\n";
this.K4="parameters {\n holeR \x3d 10\n gap \x3d 4\n lowerOffset \x3d 12.0 \x3c 17 \x3c 25\n thk \x3d 5\n h \x3d 10.0\n pinR \x3d 2.0\n outerOffset \x3d 0.5\n softenR \x3d 0.8\n}\n\n\n// Create main areas and boolean together\ncircCen \x3d pt(0, lowerOffset + holeR)\nc1 \x3d Circle(circCen, holeR)\nc2 \x3d Circle(circCen, holeR + thk)\n\nrectH \x3d lowerOffset + thk\nr1 \x3d Rectangle(pt(-gap/2, 0), gap, rectH)\nr2 \x3d Rectangle(r1.bottomLeft - pt(thk,0), gap + thk*2, rectH)\nmainBase \x3d Difference(\n    Union(r2, c2), \n    Union(r1, c1)\n)\n\np1 \x3d single(query(mainBase.points, derivedFrom(r1.bottomRight)))\nr3 \x3d Rectangle(p1,thk*2,thk/2)\nmainBase \x3d Union(mainBase, r3)\n\n// Compute radius bounds for fillets and apply them\nfilletPts \x3d query(mainBase.points, from(r2.right))\nvEdge \x3d single(query(mainBase.edges, from(r2.right)))\nhEdge \x3d single(query(mainBase.edges, from(r3.top)))\nfR \x3d min(vEdge.length / 2.0, hEdge.length - softenR - 0.001)\nmainBaseHard \x3d Fillet(mainBase.single(), filletPts, fR)\nrestPts \x3d query(mainBaseHard.points, not(derivedFromAny(filletPts))) // Useful, but maybe replace with \".filletPoints\"\nmainBase \x3d Fillet(mainBaseHard, restPts, softenR)\n\n\n// Position the clamp circle relative to the other elements\np0y \x3d single(query(mainBaseHard.edges, derivedFrom(r1.right))).midpoint.y\np0x \x3d r2.right.midpoint.x\nouterPoint \x3d single(c2.edges).start\ndx \x3d (outerPoint.x+thk - p0x) / 2\np0 \x3d pt(p0x, max(p0y, r3.topRight.y + dx))\nclampCen \x3d p0.translate(dx, 0).translate(outerOffset, 0)\n\n// Construct the clamp geometry and union it together\nclampC \x3d Circle(clampCen, dx)\npinC \x3d Circle(clampCen, pinR)\nix \x3d Intersection(mainBase, clampC) // Assert it doesn't hit anything\nempty(ix.polygons)\nclampRect \x3d Rectangle(single(clampC.points), -thk, outerPoint.y - p0.y)\nclampBase \x3d Union(clampRect, clampC).single()\nclampBase \x3d Fillet(clampBase, query(clampBase.points, from(clampC, clampRect.left)), holeR)\nclampRing \x3d {\n    rectSize \x3d clampRect.topRight.x\n    r0 \x3d Rectangle(clampRect.topRight, -rectSize, rectSize)\n    clampArc \x3d Circle(circCen, rectSize)\n    clampArc \x3d Difference(Intersection(clampArc, r0), Circle(circCen, holeR+thk+outerOffset)).single()\n    \n    extEdge \x3d single(query(clampArc.edges, from(r0.left)))\n    clampArc \x3d ExtrudeEdge(clampArc, extEdge, thk)\n    roundEnds \x3d query(clampArc.points, from(clampArc.positive.top))\n    clampArc \x3d Fillet(clampArc.single(), roundEnds, softenR)\n}\nclamp \x3d Difference(Union(clampBase, clampRing), pinC)\npinNeg \x3d Rectangle(clampRect.bottomRight.translate(0,pinR+1), -dx*2, -dx*2)\nclampClear \x3d Difference(clamp, pinNeg)\n\n\n// Lift everything into 3D\nmain3 \x3d Extrude3D(mainBase, h)\nclamp3L \x3d Extrude3D(clamp, h/4).translateZ(h/8)\nclamp3M \x3d Extrude3D(clampClear, h/4).translateZ(3*h/8)\nclamp3U \x3d clamp3L.translateZ(h/2)\nclampPin \x3d Extrude3D(pinC, h)\n\n// Positioning helper for the bottom pin\nlowerPinEdge \x3d single(query(mainBaseHard.edges, from(r2.left)))\npositionToEdge \x3d (geo) \x3d\x3e \n    geo\n     .rotateYDeg(-90)\n     .translate(lowerPinEdge.midpoint, h/2)\n\n// Construct the individual lower pin elements\nlowerPinProf \x3d Circle(pt(0,0), h/2)\nlowerHexProf \x3d Polygon(pt(0,0), 12, h/2 * 1.2)\nlowerPin \x3d positionToEdge(Extrude3D(lowerPinProf,thk))\n\n// Right now this takes a bit of math. Instead we'd like to be able \n// to just refer to the elements and do a plane2plane transform\nmidPin \x3d positionToEdge(Extrude3D(lowerPinProf, gap)).translateX(thk+gap)\nlowerHex \x3d positionToEdge(Extrude3D(lowerHexProf, thk)).translateX(-thk)\n\nlowerConeR \x3d Rectangle(pt(0,0), h/2, h/4)\nlowerConeProf \x3d Chamfer(lowerConeR, lowerConeR.topRight, h/5)\nlowerCone \x3d Revolve(lowerConeProf, lowerConeR.left).rotateXDeg(90)\nlowerCone \x3d positionToEdge(lowerCone).translateX(-2*thk)\n\ngeometry \x3d Seq(main3, clamp3L, clamp3M, clamp3U, clampPin, lowerPin, midPin, lowerHex, lowerCone)\ndraw(geometry.map(g \x3d\x3e g.rotateYDeg(-90).translateX(h)),\n     color(gray), stroke(black), style(translucent(0.9)))\n";
